import { React, useEffect, Fragment } from "react";
import PropTypes from "prop-types";
import { getCurrentProfile } from "../../actions/profile";
import { connect } from "react-redux";
import Spinner from "../layout/Spinner";
import { Link } from "react-router-dom";

const Id = ({ getCurrentProfile, auth: { user } }) => {
  useEffect(() => {
    getCurrentProfile();
  }, [getCurrentProfile]);

  return (
    <Fragment>
      <div style={{ background: "#fff", padding: "1rem", borderRadius: "5px" }}>
        {/* <h1 className='large text-primary'>Profile Dashboard</h1> */}
        <p className='lead'>test</p>
      </div>
    </Fragment>
  );
};

Id.propTypes = {
  getCurrentProfile: PropTypes.func.isRequired,

  auth: PropTypes.object.isRequired,
};

const mapStateToProps = state => ({});
export default connect(mapStateToProps, { getCurrentProfile })(Id);
